    CALL_LOG_CREATE_NEW_CONTACT = 1051

        ;

    // User deleted an entry from the voicemail tab
    VOICEMAIL_DELETE_ENTRY = 1052

        ;

    // Voicemail call log entry was expanded. Could be either if the user tapped
